import './App.css';
import LandingPage from './components/landingpage';
import ContactPage from './components/contactpage';
import APropos from './components/apropos';
import ChroniquePage from './components/chronique';
import ClosingDecouvre from './components/closingjedecouvre';
import ClosingAcademie from './components/closingacademie';
import OneArticleAcademie from './components/displayOneArticleAcademie';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import { useParams } from 'react-router-dom'

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/home" exact component={LandingPage}></Route>
          <Route path="/contact" exact component={ContactPage}></Route>
          <Route path="/apropos" exact component={APropos}></Route>
          <Route path="/chronique" exact component={ChroniquePage}></Route>
          <Route path="/jedecouvre" exact component={ClosingDecouvre}></Route>
          <Route path="/academie" exact component={ClosingAcademie}></Route>
          <Route path="/academie/:id/" exact component={OneArticleAcademie}></Route>           
        </Routes>
      </Router>
    </div>
  );
}

export default App;
